import {useGetFriendsQuery, useIncreaseScoreMutation} from "../../services/api/friends/friendsApi";
import {useSelector} from "react-redux";
import {Avatar, Box, Button, Dialog, IconButton, Stack, Typography} from "@mui/material";
import CakeIcon from '@mui/icons-material/Cake';
import {useState} from "react";
import CallIcon from '@mui/icons-material/Call';
import MessageIcon from '@mui/icons-material/Message';
import VisibilityIcon from '@mui/icons-material/Visibility';

const Overview = () => {
    const userId = useSelector(state => state.auth.user.id);
    const {data: friends, error, isLoading} = useGetFriendsQuery(userId);
    const [open, setOpen] = useState(false);

    if (isLoading) return <p>Načítání...</p>;
    if (error) return <p>Chyba při načítání přátel</p>;

    return (
        <div>
            <Stack>
                <Stack>
                    {
                        friends.map((friend, index) => {
                            return (
                                <Box key={index}>
                                    <FriendComponent friend={friend} key={friend.id} onClick={() => setOpen(true)}/>
                                </Box>
                            )
                        })
                    }
                </Stack>
            </Stack>
            <Dialog open={open} onClose={() => setOpen(false)} maxWidth={"md"}>
                <Stack p={2} alignItems="center" justifyContent="center" spacing={2}>
                    <Typography variant={"h5"}>Interakce</Typography>
                    <Stack p={1} direction="row" spacing={3}>
                        <InteractionItem icon={CallIcon} label="Called"/>
                        <InteractionItem icon={MessageIcon} label="Chatted"/>
                        <InteractionItem icon={VisibilityIcon} label="Hang Out"/>
                    </Stack>
                </Stack>
            </Dialog>
        </div>
    )
};

export default Overview;


const InteractionItem = ({icon: IconComponent, label, friend, points}) => {
    const [increaseScore, {isLoading, isError, data}] = useIncreaseScoreMutation();

    const handleIncreaseScore = async () => {
        try {
            const result = await increaseScore({friendId, points}).unwrap();  // unwrap získá výsledek bez potřeby try-catch
            console.log('Score updated successfully:', result);
        } catch (error) {
            console.error('Failed to update score:', error);
        }
    };

    return (
        <Stack alignItems="center" spacing={1}>
            <IconButton sx={{backgroundColor: "#efefef"}} onClick={handleIncreaseScore}>
                <IconComponent fontSize="large"/>
            </IconButton>
            <Typography>{label}</Typography>
        </Stack>
    );
};


const FriendComponent = ({friend, onClick}) => {
    return (
        <Stack p={2} pt={2.5} pb={2.5} spacing={2} direction={"row"} alignItems={"center"}
               borderBottom={"1px solid lightgray"}
               onClick={onClick}
        >
            <Avatar/>

            <Stack flex={1} spacing={0.5}>

                <Stack direction="row" justifyContent="space-between">
                    <Typography>{friend.name} </Typography>
                    <Stack direction="row" spacing={1} alignItems="center">
                        <CakeIcon fontSize={"small"} sx={{color: "gray"}}/>
                        <Typography sx={{color: "gray"}}>{friend.birthday}</Typography>
                    </Stack>

                </Stack>
                <ScoreBar score={friend.score}/>
            </Stack>
        </Stack>
    )
}

const ScoreBar = ({score}) => {
    const height = 10
    const percentage = calculatePercentage(score, 100)

    function calculatePercentage(part, whole) {
        if (whole === 0) {
            console.error("Cannot divide by zero")
            return 0
        }
        return (part / whole) * 100;
    }

    return (
        <Stack sx={{width: "100%", height: {height}}}
               justifyContent="center"
               alignItems="flex-start"
               border={"1px solid black"}
               borderRadius={2}
        >
            <Box sx={{
                width: `${percentage}%`,
                backgroundColor: 'white',
                height: '50px',
                borderRadius: 1.5
            }}/>
        </Stack>
    )
}
